import React from "react";
import './EventCard.css'

function EventCard(props) {

    function onPurchase(event) {

        const eventId = event.target.id;

        console.log(eventId);
        
    }

    return (  
        <div className="eventcard-container">

            <img src='https://media.harrypotterfanzone.com/philosophers-stone-20-years-of-movie-magic-harry-poster.jpg'/>

            <div className="name">
            Movie name
            </div>
            <div className="date">15th March 2022</div>
            <section className="time">
                <div>10:50:00</div>
                <div>120 Mins</div>
            </section>
            <div className="purchase">
                <button id='example' onClick={onPurchase}>Purchase</button>
            </div>
            
            
            
            
            

        </div>
    );
}

export default EventCard;
